import React from 'react';
// import CaseImages from '.../CaseImages';

export default function CaseStudyCard(props) {
    return (
        <div className="px-10 flex flex-col items-center">
            <img className="rounded-sm pb-2 min-w-max min-h-max w-96" src={props.image} alt={props.alt}/>
            <h3 className="space-y-4 pr-32 text-white font-bold">{props.header}</h3>
        </div>
        )
};
